        int[] size;
        int[] min;
        public UFDS(int N) {
            id = new int[N];
            size = new int[N];
            min = new int[N];
            for (int i = 0; i < N; i++) {
                id[i] = i;
                size[i] = 1;
                min[i] = i;
            }
        }
        private int root(int i) {
            while (i != id[i]) {
                id[i] = id[id[i]];
                i = id[i];
            }
            return i;
        }
        public void union(int p, int q) {
            int i = root(p);
            int j = root(q);
            if (i == j)
                return;
            if (size[i] < size[j]) {
                id[i] = id[j];
                size[j] += size[i];
                min[j] = Math.min(min[i], min[j]);
            } else {
                id[j] = id[i];
                size[i] += size[j];
                min[i] = Math.min(min[i], min[j]);
            }
        }
