        List<Pair<Integer, Integer>> list = new ArrayList<>();
        for (int i = 0; i < k; i++) {
            List<Integer> l = nums.get(i);
            for (int nu : l) {
                list.add(new Pair(nu, i));
            }
        }
        Collections.sort(list, (a, b) -> a.getKey() - b.getKey());
