        int totalType = 0;
        while (j < list.size()) {
            int nu = list.get(j).getKey();
            int type = list.get(j).getValue();
            store.add(nu);
            int val = mp.getOrDefault(type, 0);
            mp.put(type, val + 1);
            totalType++;
            if (mp.size() < k) {
                j++;
            } else if (mp.size() == k) {
                if (ans[0] == ans[1] && ans[1] == Integer.MAX_VALUE) {
                    ans[0] = store.get(0);
                    ans[1] = store.get(store.size() - 1);
                }
                int dif = store.get(store.size() - 1) - store.get(0);
                if (dif < ans[1] - ans[0]) {
                    ans[0] = store.get(0);
                    ans[1] = store.get(store.size() - 1);
