        qu.add(new int[] {0, 1});
        boolean[][] v = new boolean[n][m];
        int cnt = 0;
        int idx = 0;
        while (qu.size() > 0 && idx < l) {
            int[] f = qu.remove();
            int r = f[0], c = f[1];
            if (v[r][c])
