        Set<Integer> secretKeepers = new HashSet<>(List.of(0, firstPerson));
        Map<Integer, List<Integer[]>> timeToMeetings = getTimeToMeetings(meetings);
        DisjointSet disjointSet = new DisjointSet(n, secretKeepers);
