            st.push(new int[] {temperatures[j], j});
            j--;
        }
        int[] ans = new int[temperatures.length];
        int k = 0;
        for (i = arr.length - 1; i >= 0; i--) {
            ans[k++] = arr[i];
        }
        return ans;
    }
