                    if j > 0:
                        apple_in_region -= self.pfsum_row[nr][j - 1]
                    if apple_in_region:
                        cannot_cut = False
                    else:
                        nr += 1
                if nr < self.r - 1:
                    t_cnt += self.getWays(nr + 1, j, k - 1)
                nr += 1
            cannot_cut = True
            nc = j
